import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import Button from "@material-ui/core/Button";
export default class SizePicker extends Component {
  render() {
    return (
      <Grid container spacing={4}>
        <Grid item>
          <Button>S</Button>
          <Button>M</Button>
          <Button>L</Button>
          <Button>XL</Button>
        </Grid>
      </Grid>
    );
  }
}
